import {
  TOP_CHART_MUSIC,
  NEW_RELEASES,
  SONG_DATA,
} from "../ActionTypes/ActionTypes";

const initialState = {
  topCharts: [],
  newReleases: [],
  songData: [],
};

export default function (state = initialState, action) {
  console.log(action.songData);
  switch (action.type) {
    case TOP_CHART_MUSIC:
      return {
        ...state,
        topCharts: action.payload,
      };
    case NEW_RELEASES:
      return {
        ...state,
        newReleases: action.payload,
      };
    case SONG_DATA:
      return {
        ...state,
        songData: action.songData,
      };
    default:
      return state;
  }
}
